import React from 'react';
import './styles.css';

const Authors = () => (
  <authors className='home-Authors'>
  
      <div class="profile">
          <div className="profile-img">
            <img src="assets/images/profilePhoto.png" alt="Profile Photo"/>
            <p class="Author-name"></p>
          </div>
      </div>
  
  </authors>
);

export default Authors;
